// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract IdentityAuthorization {
    
    // Struct to represent a user
    struct User {
        uint256 userId;
        string name;
        address walletAddress;
        address higherAuthority; // Address of higher authority who can approve/reject requests
        bool isRegistered;
        bool isAdmin;
        bool isHigherAuthority;
    }
    
    mapping(address => User) public users; // Mapping to store users
    
    address public admin; // Address of the contract admin
    
    // Modifier to restrict access to admins only
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    // Modifier to restrict access to higher authorities only
    modifier onlyHigherAuthority() {
        require(users[msg.sender].isHigherAuthority, "Only higher authorities can perform this action");
        _;
    }
    
    // Modifier to ensure only registered users can perform actions
    modifier onlyRegisteredUser() {
        require(users[msg.sender].isRegistered, "User is not registered");
        _;
    }
    
    // Event for user registration
    event UserRegistered(address indexed userAddress, uint256 indexed userId, string name);
    
    // Event for role update
    event UserRoleUpdated(address indexed userAddress, bool isAdmin, bool isHigherAuthority);
    
    // Constructor to set the admin when deploying the contract
    constructor() {
        admin = msg.sender;
    }
    
    // Function to register a new user
    function registerUser(string memory _name) external {
        require(!users[msg.sender].isRegistered, "User is already registered");
        
        uint256 userId = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender))) % 1000000; // Generate unique userId
        
        users[msg.sender] = User({
            userId: userId,
            name: _name,
            walletAddress: msg.sender,
            higherAuthority: address(0),
            isRegistered: true,
            isAdmin: false,
            isHigherAuthority: false
        });
        
        emit UserRegistered(msg.sender, userId, _name);
    }
    
    // Function to authorize a higher authority
    function authorizeHigherAuthority(address _higherAuthority) external onlyAdmin {
        require(users[_higherAuthority].isRegistered, "Higher authority must be a registered user");
        require(!users[_higherAuthority].isHigherAuthority, "Address is already a higher authority");
        
        users[_higherAuthority].isHigherAuthority = true;
        
        emit UserRoleUpdated(_higherAuthority, users[_higherAuthority].isAdmin, true);
    }
    
    // Function to update roles (admin or higher authority)
    function updateRole(address _userAddress, bool _isAdmin, bool _isHigherAuthority) external onlyAdmin {
        require(users[_userAddress].isRegistered, "User must be a registered user");
        
        users[_userAddress].isAdmin = _isAdmin;
        users[_userAddress].isHigherAuthority = _isHigherAuthority;
        
        emit UserRoleUpdated(_userAddress, _isAdmin, _isHigherAuthority);
    }
    
    // Function to get user details
    function getUserDetails(address _userAddress) external view returns (uint256, string memory, address, address, bool, bool, bool) {
        User memory user = users[_userAddress];
        return (user.userId, user.name, user.walletAddress, user.higherAuthority, user.isRegistered, user.isAdmin, user.isHigherAuthority);
    }
    
    // Function to check if a user is registered
    function isUserRegistered(address _userAddress) external view returns (bool) {
        return users[_userAddress].isRegistered;
    }
    
    // Function to check if a user is a higher authority
    function isUserHigherAuthority(address _userAddress) external view onlyRegisteredUser returns (bool) {
        return users[_userAddress].isHigherAuthority;
    }
}

contracts/02_DocumentVerification.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./01_IdentityAuthorization.sol";

contract DocumentVerification {
    
    IdentityAuthorization identityContract; // Instance of IdentityAuthorization contract
    
    // Struct to represent a document
    struct Document {
        uint256 documentId;
        address owner;
        string documentHash;
        bool isVerified;
        address verifiedBy;
    }
    
    mapping(uint256 => Document) public documents; // Mapping to store documents
    uint256 public documentCount; // Counter for document IDs
    
    // Event for document submission
    event DocumentSubmitted(uint256 indexed documentId, address indexed owner, string documentHash);
    
    // Event for document verification
    event DocumentVerified(uint256 indexed documentId, address indexed verifiedBy, bool isVerified);
    
    // Constructor to set the address of the IdentityAuthorization contract
    constructor(address _identityContractAddress) {
        identityContract = IdentityAuthorization(_identityContractAddress);
    }
    
    // Modifier to ensure only registered users can submit documents
    modifier onlyRegisteredUser() {
        require(identityContract.isUserRegistered(msg.sender), "User is not registered");
        _;
    }
    
    // Modifier to restrict access to higher authorities only
    modifier onlyHigherAuthority() {
        require(identityContract.isUserHigherAuthority(msg.sender), "Only higher authorities can perform this action");
        _;
    }
    
    // Function to submit a new document
    function submitDocument(string memory _documentHash) external onlyRegisteredUser {
        documentCount++;
        
        documents[documentCount] = Document({
            documentId: documentCount,
            owner: msg.sender,
            documentHash: _documentHash,
            isVerified: false,
            verifiedBy: address(0)
        });
        
        emit DocumentSubmitted(documentCount, msg.sender, _documentHash);
    }
    
    // Function to verify a document
    function verifyDocument(uint256 _documentId, bool _isVerified) external onlyHigherAuthority {
        Document storage document = documents[_documentId];
        
        require(document.owner != address(0), "Document does not exist");
        require(!document.isVerified, "Document is already verified");
        
        document.isVerified = _isVerified;
        document.verifiedBy = msg.sender;
        
        emit DocumentVerified(_documentId, msg.sender, _isVerified);
    }
    
    // Function to get document details
    function getDocumentDetails(uint256 _documentId) external view returns (uint256, address, string memory, bool, address) {
        Document memory document = documents[_documentId];
        return (document.documentId, document.owner, document.documentHash, document.isVerified, document.verifiedBy);
    }
}

contracts/03_NftContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./01_IdentityAuthorization.sol";
import "./02_DocumentVerification.sol";

contract DocumentNFT is ERC721URIStorage, Ownable {
    // References to external contracts
    IdentityAuthorization private immutable identityAuthorization;
    DocumentVerification private immutable documentVerification;

    // Counter for NFT IDs
    uint256 public tokenCount;

    // Event emitted on NFT minting
    event Minted(uint256 indexed tokenId, address indexed recipient, string tokenURI);

    constructor(address identityContractAddress, address documentVerificationAddress) ERC721("DocumentNFT", "DNFT") Ownable(msg.sender) {
        identityAuthorization = IdentityAuthorization(identityContractAddress);
        documentVerification = DocumentVerification(documentVerificationAddress);
    }

    // Modifier to restrict minting to authorized users
    modifier onlyAuthorized() {
        require(identityAuthorization.isUserHigherAuthority(msg.sender), "Unauthorized: Only higher authorities can mint");
        _;
    }

    // Mint NFT for a verified document
    function mintNFT(uint256 documentId, string memory uri) public onlyAuthorized {
        (, address owner, , bool isVerified, ) = documentVerification.getDocumentDetails(documentId);
        require(isVerified, "Document not verified");

        tokenCount++;
        _mint(owner, tokenCount);
        _setTokenURI(tokenCount, uri);

        emit Minted(tokenCount, owner, uri);
    }

    // Transfer NFT to another address
    function transferNFT(address recipient, uint256 tokenId) public {
        require(_isApprovedOrOwner(msg.sender, tokenId), "Unauthorized transfer: Not owner or approved");
        _transfer(msg.sender, recipient, tokenId);
    }

    // Override for handling conflicts in multiple inheritance
    function burn(uint256 tokenId) internal {
        super._burn(tokenId);
    }

    // Override for handling conflicts in multiple inheritance
    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        return super.tokenURI(tokenId);
    }

    // Internal function to check approval or ownership
    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view returns (bool) {
        address owner = ownerOf(tokenId);
        require (owner != address(0), "");
        return (spender == owner || getApproved(tokenId) == spender || isApprovedForAll(owner, spender));
    }
}

